#include <iostream>

using namespace std;

class Solution {
public:
    int lengthOfLongestSubstring(string s) {
        int s_size = s.size();
        if(0 == s_size)
        {
            return 0;
        }
        
        int alphabet_table[256] = {0};
        int longest_length = -1;
        int temp_longest_length = 0;
        int index = 1;
        for(auto& ch : s)
        {
            int temp = ch;
            //std::cout << ch;
            if(0 == alphabet_table[temp])
            {
                temp_longest_length++;
                //std::cout << "  1 len:" << temp_longest_length;
                alphabet_table[temp] = index;
            }
            else if(0 != alphabet_table[temp])
            {
                if(longest_length < temp_longest_length)
                {
                    longest_length = temp_longest_length;
                }
                int diff = index - alphabet_table[temp];
                if(diff > temp_longest_length)
                {
                    temp_longest_length++;
                }
                else
                {
                    temp_longest_length = diff;
                }
                //std::cout << "  2 len:" << temp_longest_length;
                alphabet_table[temp] = index;
            }
            //std::cout << std::endl;
            index++;
        }

        if(longest_length < temp_longest_length)
        {
            longest_length = temp_longest_length;
        }
        return longest_length;
    }
};

